import React from "react";

function Bule() {

  

  return (
    <>
      {window.sessionStorage.getItem("Dif") && (
        <>
          <div
            className="fullPage l"
            style={{
              display: "flex",
              justifyContent: "flex-start",
              flexDirection: "column",
              padding: "0 100px",
            }}
          >
            <div className="cerinta">
              trage an pl bulele
            </div>
            <div className="cheie">
              <img src={require("../")} alt=""/>
            </div>
          </div>
        </>
      )}
    </>
  );
}

export default Bule;
